import React from "react";
import { createPath } from "react-router-dom";

export default function Colors(props) {
	const {category, colors, setCategory} = props;

	function ColorsList() {
		let colorSelects = [];
		for (const color in colors) {
			console.log(category.colors)
			colorSelects.push(
				<li className="color-option" key={colors[color]}>
					<span className="color-option__color" style={{backgroundColor: colors[color]}} />
					<span className="color-option__name">{color}</span>
				</li>
			)
		}
		return colorSelects;
	}

	return (
		<div className="form-group">
			<ul className="color-dropdown">
				{ColorsList()}
			</ul>
		</div>
	)
}
